import React from 'react';
import './NoteList.css';
import Note from './Note';

function NoteList({ notes, deleteNote }) {
  return (
    <div className="note-list"> {/* Apply the note-list class */}
      {notes.map((note) => (
        <Note key={note.id} note={note} deleteNote={deleteNote} />
      ))}
    </div>
  );
}

export default NoteList;
